import React from 'react';
import './static/signup.css';

function Register(){
	return (

			<div className="wrapper fadeInDown">
			  <div id="formContent">
			    {/* <!-- Tabs Titles */}

			    <h2 className="inactive underlineHover"> Sign In </h2>
			    <h2 className="active">Sign Up </h2>

			    {/* Icon */}

			    <div className="fadeIn first">
			      <img src="http://danielzawadzki.com/codepen/01/icon.svg" id="icon" alt="User Icon" />
			    </div>

			    {/* Login Form */}

			    <form>
			      <input type="text" id="login" className="fadeIn second trans" name="email" placeholder="Email" required/>
			      <input type="text" id="login" className="fadeIn second trans" name="name" placeholder="Username"  required/>		      
			      <input type="password" id="password" className="fadeIn third trans" name="password" placeholder="Password" required/>
			      <input type="submit" className="fadeIn fourth trans" value="Register" />
			    </form>

			    {/* Remind Passowrd */}

			    <div id="formFooter">
			      <a className="underlineHover" href="#">Already have an account ?</a>
			    </div>

			  </div>
			</div>

		);
}

export default Register
